import React from "react";
import { FcLike } from "react-icons/fc";
<FcLike />;

const Card = ({ data }) => {
  return (
    <div>
      <div>
        <img src={data.image.url} />
        <div>
          <button>
            <FontAwesomeIcon icon="fa-regular fa-heart" />
          </button>
        </div>
      </div>
    </div>
  );
};

export default Card;
